import java.util.Scanner;

public class Bathroom {
    public static void main(String[] args) {
        String myInput = "    ";

        Scanner input = new Scanner(myInput);
        int current = 5;
        String code = "";

        while (input.hasNext()) {
            String line = input.next();
            for (int i = 0; i < line.length(); i++) {
                char move = line.charAt(i);

                if (current == 1) {
                    if (move == 'D') current = 4;
                    else if (move == 'R') current = 2;
                } else if (current == 2) {
                    if (move == 'L') current = 1;
                    else if (move == 'D') current = 5;
                    else if (move == 'R') current = 3;
                } else if (current == 3) {
                    if (move == 'L') current = 2;
                    else if (move == 'D') current = 6;
                } else if (current == 4) {
                    if (move == 'U') current = 1;
                    else if (move == 'D') current = 7;
                    else if (move == 'R') current = 5;
                } else if (current == 5) {
                    if (move == 'U') current = 2;
                    else if (move == 'D') current = 8;
                    else if (move == 'L') current = 4;
                    else if (move == 'R') current = 6;
                } else if (current == 6) {
                    if (move == 'U') current = 3;
                    else if (move == 'D') current = 9;
                    else if (move == 'L') current = 5;
                } else if (current == 7) {
                    if (move == 'U') current = 4;
                    else if (move == 'R') current = 8;
                } else if (current == 8) {
                    if (move == 'U') current = 5;
                    else if (move == 'L') current = 7;
                    else if (move == 'R') current = 9;
                } else if (current == 9) {
                    if (move == 'U') current = 6;
                    else if (move == 'L') current = 8;
                }
            }
            code += current;
        }

        System.out.println("Bathroom code: " + code);
    }
}
